import React, { useState, useEffect } from 'react';
import { Container, Typography, Paper } from '@mui/material';
import './Settings.css';
import { FunctionHeatmapModule } from '../modules/FunctionHeatmapModule';

export const Settings = () => {
  const [theme, setTheme] = useState('light');

  const handleThemeChange = (event) => {
    const newTheme = event.target.value;
    setTheme(newTheme);
    document.body.setAttribute('data-theme', newTheme);
    localStorage.setItem('theme', newTheme);
  };

  useEffect(() => {
    const savedTheme = localStorage.getItem('theme') || 'light';
    setTheme(savedTheme);
    document.body.setAttribute('data-theme', savedTheme);
  }, []);

  const DebugPanel = () => {
    useEffect(() => {
        const container = document.getElementById('function-heatmap');
        if (container) {
            FunctionHeatmapModule.visualize(container);
            
            // Update every 5 seconds
            const interval = setInterval(() => {
                FunctionHeatmapModule.visualize(container);
            }, 5000);
            
            return () => clearInterval(interval);
        }
    }, []);

    return (
        <div className="debug-panel">
            <h3>Function Usage Heatmap</h3>
            <div id="function-heatmap"></div>
            <button onClick={() => FunctionHeatmapModule.reset()}>Reset Stats</button>
            <button onClick={() => {
                const stats = FunctionHeatmapModule.exportStats();
                const blob = new Blob([JSON.stringify(stats, null, 2)], { type: 'application/json' });
                const url = URL.createObjectURL(blob);
                const a = document.createElement('a');
                a.href = url;
                a.download = 'function-stats.json';
                a.click();
                URL.revokeObjectURL(url);
            }}>Export Stats</button>
        </div>
    );
  };

  return (
    <Container>
      <Paper sx={{ p: 3, mt: 3 }}>
        <Typography variant="h4">Settings</Typography>
        <div className="settings-container">
          <div className="setting-item">
            <label htmlFor="theme-dropdown">Color Theme:</label>
            <select 
              id="theme-dropdown"
              value={theme}
              onChange={handleThemeChange}
              className="theme-select"
            >
              <optgroup label="Standard Themes">
                <option value="light">Default</option>
                <option value="dark">Dark</option>
                <option value="secondary">Secondary</option>
              </optgroup>
              <optgroup label="Seasonal Themes">
                <option value="winter">Winter</option>
                <option value="summer">Summer</option>
                <option value="fall">Fall</option>
                <option value="spring">Spring</option>
              </optgroup>
              <optgroup label="Accessibility Themes">
                <option value="deuteranopia">Deuteranopia-friendly</option>
                <option value="protanopia">Protanopia-friendly</option>
                <option value="tritanopia">Tritanopia-friendly</option>
                <option value="high-contrast">High Contrast</option>
                <option value="monochrome">Monochrome</option>
              </optgroup>
            </select>
          </div>
        </div>
        <DebugPanel />
      </Paper>
    </Container>
  );
};
